import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBox, faCalendarAlt,faRoad } from '@fortawesome/free-solid-svg-icons';


export default function Details() {
 

  
  return(
    <div className="main2"> 
      <div className="container">
        <div className="details container">
        <div className="row row-cols-sm-1 row-cols-md-2 row-cols-lg-3 g-4">
           
              <div className="col ">
                  <div className="box card-body p-0  shadow-sm mb-5">
                   
                    <div className="box_content">
                
                     <div className="row pl-2 pr-2">
                     <img
  src={fruits}
  alt=""
  className="img-fluid"
  style={{
    height: "270px",
    width: "100%",
    objectFit: "cover",
    borderRadius: "20px"
  }}
/>

                     <h4>Legume</h4>
                      <button style={{background : "#cccccc00", color : "var(--main)"}} className="btn1">Detalii</button>
                    </div>
                  </div>
                </div>
                </div>
             
          </div>
        </div>
      </div>
      <div className="center">
      <Link to="/IndexPage" className="btn">
        Vezi toate <span>anunturile</span>
      </Link>
    </div>
    </div>
  );
};
